import React from "react";
import Sdata from "./Sdata";
import Card from "./Cards";


const  Netflix = () => {
return (
    <Card
      key={Sdata[1,2].id}
      imgsrc={Sdata[1,2].imgsrc}
      title={Sdata[1,2].title}
      sname={Sdata[1,2].sname}
      link={Sdata[1,2].link}
    />
);
}


export default Netflix;
